import React from 'react';
import Button from 'react-bootstrap/Button';

export default function PlayerButton({ player, isActive, onToggle }) {
  return (
    <Button
      onClick={() => onToggle(player.id)}
      variant={isActive ? 'success' : 'secondary'}
    >
    </Button>
  );
}
